package lsieun;import org.objectweb.asm.Type;public class ASMType {    public static void main(String[] args) {        Type t = Type.getType("Ljava/lang/String;");        int sort = t.getSort();        String className = t.getClassName();        String internalName = t.getInternalName();        String descriptor = t.getDescriptor();        System.out.println(sort);        System.out.println(className);        System.out.println(internalName);        System.out.println(descriptor);        Type t2 = Type.getType("[[[[[Ljava/lang/String;");        int dimensions = t2.getDimensions();        Type elementType = t2.getElementType();        System.out.println(dimensions);        System.out.println(elementType);        Type t3 = Type.getType("(Ljava/lang/String;I)V");        String descriptor1 = t3.getDescriptor();        Type[] argumentTypes = t3.getArgumentTypes();        Type returnType = t3.getReturnType();        System.out.println("Descriptor: " + descriptor1);        System.out.println("Argument types:");        for (Type argumentType : argumentTypes) {            System.out.println("  " + argumentType);        }        System.out.println("Return Type: " + returnType);    }}